  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed innovation is a \"Microfluidic
  Multichannel Flow Cytometer.\"  Several novel concepts are integrated to produce
  the final design, which is compatible with on-orbit operation from the standpoint
  of gravity-independence, low mass, low power requirement and automated operation.
  \ The unique design features of the Microfluidic Multichannel Flow Cytometer include
  compact optics based on diode technology for both illumination and measurement,
  tested channel branching schemes, no sheath fluid anywhere, bubble-free PDMS lithographic
  manufacture, and analysis based on quantum-dot technology.  A design is proposed
  that counts RBC, WBC and three specified WBC subsets. Techshot, Inc. and scientists
  at Purdue University will collaborate to test the components of this innovation
  by pursuing the following Phase I objectives: (1) create a critical design requirements
  document for the Microfluidic Multichannel Flow Cytometer, (2) breadboard and test
  its three critical physical components (illumination, sensing optics and flow channels)
  and (3) critically test feasibility of each component  and produce a top-level drawing
  suitable for initiating Phase II R/R&amp;D to produce an integrated prototype.  The
  final product will be robust for use in space flight and low-cost on Earth for eventual
  point-of-care blood analysis and global AIDS patient status monitoring.\",\n\t\"license_title\":
